{

    internal InnerFlowErrorHandlingConfigFactory ErrorHandlingConfigFactory { get; set; }

    internal InnerFlowSuccessResponseHandlingConfigFactory SuccessResponseHandlingConfigFactory { get; set; }

    protected override Humidifier.AppFlow.FlowTypes.SAPODataDestinationProperties Create()
    {
        var sAPODataDestinationPropertiesResult = CreateSAPODataDestinationProperties();
        factoryAction?.Invoke(sAPODataDestinationPropertiesResult);

        return sAPODataDestinationPropertiesResult;
    }

    private Humidifier.AppFlow.FlowTypes.SAPODataDestinationProperties CreateSAPODataDestinationProperties()
    {
        var sAPODataDestinationPropertiesResult = new Humidifier.AppFlow.FlowTypes.SAPODataDestinationProperties();

        return sAPODataDestinationPropertiesResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.FlowTypes.SAPODataDestinationProperties result)
    {
        base.CreateChildren(result);

        result.ErrorHandlingConfig ??= ErrorHandlingConfigFactory?.Build();
        result.SuccessResponseHandlingConfig ??= SuccessResponseHandlingConfigFactory?.Build();
    }

} // End Of Class

